con:configuration.scriptText:
// Check response time
assert messageExchange.timeTaken < 400
log.info messageExchange.getTimeTaken()

// check for Endpoint
//log.info messageExchange.getEndpoint()
def endPoint = "http://www.oorsprong.org/websamples.countryinfo/CountryInfoService.wso"
assert messageExchange.getEndpoint() == endPoint

//check for header
assert messageExchange.responseHeaders["Content-Length"] != null

//check for attachments
assert messageExchange.responseAttachments.length == 0

// validate response nodes
def groovyUtils = new com.eviware.soapui.support.GroovyUtils(context)
//def requestHolder = groovyUtils.getXmlHolder(messageExchange.requestContent)
def responseHolder = groovyUtils.getXmlHolder(messageExchange.responseContent)
def currencyName = responseHolder.getNodeValue("//m:CountryCurrencyResult/m:sName")
assert currencyName == "Rupees"
assert responseHolder.getNodeValue("//m:CountryCurrencyResult/m:sISOCode") == "INR"

// to get the response
def resp = messageExchange.responseContentAsXml
log.info resp

import groovy.json.JsonSlurper def responseMessage = messageExchange.response.responseContent def json = new JsonSlurper().parseText(responseMessage)
//asser nade values log.info json.name assert json.capital != null assert json.name.toString() == "[Taiwan]"
testStepName = messageExchange.modelItem.testStep.name log.info testStepName xmlHold = messageExchange.responseContentAsXml.toString()

con:soapui-project.con:afterLoadScript:
def setup = new File("setup.txt").text
def tearDown = new File("teardown.txt").text

project.getTestSuiteList().each{
	testSuite ->
	testSuite.getTestCaseList().each{
		testCase ->
		testCase.setSetupScript(setup)
		testCase.setTearDownScript(tearDown)
	}
}
